Often we want functions to perform a given operation with some default arguments. Suppose, for example that we have a function that strips the last characters from a string. And further suppose that when we strip characters, we usually want to strip only the last character in the string. We can do this using a function like the one below. strip_ending <- function(s, m = 1) { n <- nchar(s) # get number of characters new_s <- substr(s, 1, n - m) # cut `m` characters return(new_s)
} Now, we can call this function to remove the last characters of a string. By default, it will remove the last 1 character, but we can changes this to be any number we want. This is illustrated below. my_name <- "jones." a <- strip_ending(my_name) b <- strip_ending(my_name, m = 3) print(a)
print(b) Running the above code, we see that the first function call creates an object a that holds the string "jones", and the string b that holds the string "jon". And of course, we note that the two function calls are taking the same input string as their first argument (i.e., my_name); the only difference is that in the first case, we let the default argument determine the number of characters to strip off the end—in the second case, we specify it explicitly. Note that in R (unlike in Python), indentation is not actually required for defining code blocks. The use of curly braces (i.e., { and }) is what R uses to denote code blocks. Nonetheless, indentation makes our code vastly more readable, and we will always use indentation in practice.

