Much like the if statement, the else statement can be used to execute some piece of code based on conditions being met or not met. The example below extends our previous example. u <- 27 if (u > 100000) { print("u is a large number!")
} else { print("u is not that large...")
} As we see in the example above, the code in the else block is executed since u is set to be less than 100000. Note that the else block must follow an if block. But note also that not every if block has an else block.

