A common pattern, and one that you may use yourself is to have a sequence of if and else statements. Consider the example below. today <- "Friday" if (today == "Monday") { print("Boo...")
} else if (today %in% c("Tuesday", "Wednesday", "Thursday")) { print("...")
} else if (today %in% c("Friday", "Saturday", "Sunday")) { print("Yay!")
} else { print("Hmm... what day is this?")
} The code above has a few different possible paths of execution; in particular, there are 4 possible paths that the code might take based on the content of the variable today. Note that the possible branches here are mutually exclusive; that is, only one of those four branches will execute on any given run of this code. As an aside, the code block above also introduces the %in% operator, which checks for containment. Essentially, the expression a %in% b returns a boolean value when a is an element of b. For example 3 %in% 1:10 would return TRUE since 3 is in the range of 1 to 10.

