One of the most commonly used constructs in almost any programming language is the for loop. The for loop gives us a way to execute a give code block a specified number of times. For example, the code snippet below prints the integers from 1 to 5. for (i in 1:5) { print(i)
} It is worth pointing out here that directly after the for statement, and in between the parentheses, is where we specify how many iterations the loop will execute. Specifically, when we say (i in 1:5), what we are actually saying is that the code block will execute 5 times, with i taking a different value each time (i.e., 1 on the first iteration, 2 on the second, and so on). Note that there is no requirement that we use the index variable (e.g., i) in the body of our loop. Also note that the index variable can be named arbitrarily, just like any other variable in R. Consider the example below. for (soup in 1:6) { print("Hello!")
} In the above example, we call our index varaible soup; and note that we never actually use the variable in the loop's body.
